css:
.panes {
  display: -webkit-flex;
  -webkit-flex: 1;
}
.panes .pane-column {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
}
.panes .pane-row {
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: row;
}
.panes .pane {
  position: relative;
  display: -webkit-flex;
  -webkit-flex: 1;
  -webkit-flex-direction: column;
  overflow: hidden;
}
.panes .pane .item-views {
  -webkit-flex: 1;
  display: -webkit-flex;
  min-height: 0;
  min-width: 0;
  position: relative;
}
.panes .pane .item-views .pane-item {
  color: #444444;
  background-color: #f4f4f4;
}
.panes .pane .item-views > *,
.panes .pane .item-views > .react-wrapper > * {
  position: absolute;
  top: 0;
  right: 0;
  bottom: 0;
  left: 0;
}
